import ChatContainer from '../pages/chat/container'
import Setting from '../pages/setting'
import MessageSetting from '../pages/setting/message'
import MailList from '../pages/mail-list'

export const Routers = [
    {
        path: '/',
        components: ChatContainer
    },
    {
        path: '/mail-list',
        components: MailList
    },
    {
        path: '/setting',
        components: Setting
    },
    {
        path: '/set-message',
        components: Setting
    }
]
